class TestDataAnalysis(unittest.TestCase):
    
    def setUp(self):
        self.analyseSheep = AnalyseSheep()
    
    def test_start_and_end_data(self):
        data = self.analyseSheep.find_start_and_end_data(sampleDataFile, sampleStartDate, sampleEndDate)
        
        assert_frame_equal(data, expectedData, "Error in start and end data calculation")
    
    def test_average_hertz_per_second(self):
        data = self.analyseSheep.find_start_and_end_data(sampleDataFile, sampleStartDate, sampleEndDate)
        self.analyseSheep.get_average_hertz_per_second(data)
        hertz = self.analyseSheep.avg_hertz
        
        self.assertEqual(hertz, expectedHertz, "Error in hertz per second calulation")
        
    def test_calculate_dates(self):
        self.analyseSheep.data = self.analyseSheep.find_start_and_end_data(sampleDataFile, sampleStartDate, sampleEndDate)
        self.analyseSheep.get_average_hertz_per_second(self.analyseSheep.data)
        self.analyseSheep.calculate_dates()
        dates = self.analyseSheep.data['DATE']
        
        assert_series_equal(dates, expectedDates['DATE'], "Error in date calculcation/ propogation")

